// SPDX-License-Identifier: Non-Licensed
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Pausable.sol";
import "../node_modules/@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Context.sol";
import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";


contract Master is Context, AccessControlEnumerable, ERC721Enumerable, ERC721Burnable, ERC721Pausable {
    using Counters for Counters.Counter;
    using Strings for uint256;

    Counters.Counter private _tokenIdTracker;

    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");

    string private _tmpName ="MINTED: Open Editions Song Collection";
    string private _tmpSymbol ="MUSICBYMINTED";

    // Optional mapping for token URIs
    mapping (uint256 => string) private _tokenURIs;
    mapping (uint256 => address) private _tokenCreators;

    // Base URI
    string private _baseURIextended;


    constructor() ERC721(_tmpName, _tmpSymbol) {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());

        _setupRole(MINTER_ROLE, _msgSender());
        _setupRole(PAUSER_ROLE, _msgSender());
    }

    function addOwnerOfContract(address newOwner) public{
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "Master: must have admin role!");
        _setupRole(DEFAULT_ADMIN_ROLE, newOwner);
    }

    function setBaseURI(string memory baseURI_) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "Master: must have admin role!");
        _baseURIextended = baseURI_;
    }

    function testContractOwner() public view returns (string memory){
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "Master: must have admin role!");
        return "You are contract owner!";
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _baseURIextended;
    }

    function GetBaseURI() public view returns (string memory) {
        return _baseURIextended;
    }

    function _setTokenURI(uint256 tokenId, string memory _tokenURI, address creator) internal virtual {
        require(_exists(tokenId), "Master: URI set of nonexistent token");
        _tokenURIs[tokenId] = _tokenURI;
        _tokenCreators[tokenId] = creator;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "Master: URI query for nonexistent token");

        string memory _tokenURI = _tokenURIs[tokenId];
        string memory base = _baseURI();
        
        // If there is no base URI, return the token URI.
        if (bytes(base).length == 0) {
            return _tokenURI;
        }
        // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
        if (bytes(_tokenURI).length > 0) {
            return string(abi.encodePacked(base, _tokenURI));
        }
        // If there is a baseURI but no tokenURI, concatenate the tokenID to the baseURI.
        return string(abi.encodePacked(base, tokenId.toString()));
    }

    //ToDo:
    //_IPFSHashHasBeenSet(uint256) param: tokenID return bool 
    //_niftyIPFSHashes(uint256) param: tokenID return string
    // baseURI= https://api.niftygateway.com/eminemopens/; tokenId=26200010675 ; metadata: https://api.niftygateway.com/eminemopens/26200010675/
    // contractId return uint256 (give it a number)
    // name() returns string contract name <- IMPLEMENTED
    // nameOfCreator() returns string (name of Artist who created)
    // masterRegistryContract() return address <- should give us back the parent contract that is using from us
    // tokenIPFSHash(uint256) returns string <- it returned the hash of the video



    function tokenCreator(uint256 tokenId) public view returns(address) {
        require(_exists(tokenId), "Master: URI query for nonexistent token");

        return _tokenCreators[tokenId];
    }

    function mint(address to, string memory tokenURI_, uint256 tokenId) public virtual {
        require(hasRole(MINTER_ROLE, _msgSender()), "Master: must have minter role to mint");
        require(!_exists(tokenId), "Master: TokenId already existent");


        // We cannot just use balanceOf to create the new tokenId because tokens
        // can be burned (destroyed), so we need a separate counter.
        _tokenIdTracker.increment();
        // uint256 newItemId = _tokenIdTracker.current();

        _safeMint(to, tokenId);
        _setTokenURI(tokenId, tokenURI_, to);
    }

    function totalOfMintedTokens() public view returns(string memory) {
        // return uint256 is you wish to return a BigNumber
        uint256 numberOfMintedTokens = _tokenIdTracker.current();
        return numberOfMintedTokens.toString();
    }

    function transferNft(uint256 _userId, uint256 tokenId) public payable {
        
        // Whith this even if nft is outside of us owned it will pay the author
        //todo: decide the value to be transferred
        sendAmountUsingAddress(_tokenCreators[tokenId], msg.value);

        transferNftByUserId(_userId,tokenId);
    }

    function transferNftByUserId(uint256 receiverUserId, uint256 tokenId) private {
        require(receiverUserId > 0, 'The user is not valid.');
        
        User memory _user = users[receiverUserId];
        address _receiverAddress = _user.userAddress;
        
        safeTransferFrom(msg.sender, _receiverAddress, tokenId);
    }

    function pause() public virtual {
        require(hasRole(PAUSER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have pauser role to pause");
        _pause();
    }

    function unpause() public virtual {
        require(hasRole(PAUSER_ROLE, _msgSender()), "ERC721PresetMinterPauserAutoId: must have pauser role to unpause");
        _unpause();
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual override(ERC721, ERC721Enumerable, ERC721Pausable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(AccessControlEnumerable, ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    uint256 public userCount = 0;

    struct User {
        uint256 id;
        string userName;
        address payable userAddress;
        uint256 amount;
    }

    mapping(uint256 => User) public users;

    // Events
    event amountTransferred(
        uint256 id,
        string userName,
        address payable userAddress,
        uint256 amount
    );

    event UserCreated(
        uint256 id,
        string userName,
        address payable userAddress,
        uint256 amount
    );

    // create user
    function createUser(string memory _userName) public {
        require(bytes(_userName).length > 0 && msg.sender != address(0x0), 'Username & Address must not be null.');

        ++userCount;

        users[userCount] = User(userCount, _userName, payable(msg.sender), msg.sender.balance);

        emit UserCreated(userCount, _userName, payable(msg.sender), msg.sender.balance);
    }

    function createUserWithMinterRole(string memory _userName) public {
        require(bytes(_userName).length > 0 && msg.sender != address(0x0), 'Username & Address must not be null.');
        _setupRole(MINTER_ROLE, _msgSender());
        
        ++userCount;

        users[userCount] = User(userCount, _userName, payable(msg.sender), msg.sender.balance);

        emit UserCreated(userCount, _userName, payable(msg.sender), msg.sender.balance);
    }

    // send amount
    function sendAmount(uint256 receiverUserId) public payable {
        require(receiverUserId > 0, 'The user is not valid.');
        require(msg.value > 0, 'Amount must not be equal to 0');
        
        User memory _user = users[receiverUserId];
        
        address payable _receiverAddress = _user.userAddress;
        
        _receiverAddress.transfer(msg.value);

        _user.amount += msg.value;

        users[receiverUserId] = _user;

        emit amountTransferred(receiverUserId, _user.userName, _receiverAddress, _user.amount);
    }

    //todo: https://consensys.net/diligence/blog/2019/09/stop-using-soliditys-transfer-now/
    function sendAmountUsingAddress(address _user, uint256 amount) public payable {
        address payable user = payable(_user);
        user.transfer(amount);
        //todo: update values!!!
    }
}
